import React, {useState, useEffect} from 'react';
import {ViewProductContext} from '../../context/ViewProductContext';

export default function Section5SlideWrapSlide({상품}) {
    const {setViewProductFn} = React.useContext(ViewProductContext);
    const [time, setTime] = useState({
        H: 0,
        M: 0,
        S: 0
    });

    useEffect(()=>{
        let setId = setInterval(function(){
            let timeSale = '2023-07-27 21:00:00';
            let start = new Date(timeSale);
            start.setHours(start.getHours()+24);
            let now = new Date();
            let countTime = start - now;
            let h, m, s = 0;

            if(now >= start) {
                clearInterval(setId);
                h = 0;
                m = 0;
                s = 0;
            } else {
                h = Math.floor(countTime / (60*60*1000)) % 24;
                m = Math.floor(countTime / (60*1000)) % 60;
                s = Math.floor(countTime / (1000)) % 60;
            }
            setTime({
                ...time,
                H: h < 10 ? `0${h}` : h,
                M: m < 10 ? `0${m}` : m,
                S: s < 10 ? `0${s}` : s
            });
        }, 1000);
    },[]);

    // 최근 본 상품
    const onClickViewProduct=(e, item, imgPath)=>{
        e.preventDefault();
        setViewProductFn(item, imgPath); 
    }
    return (
        <ul className="slide-wrap">
            <li className="slide slide1">
                <div className="slide-gap">
                    <ul>
                        <li><h2>뷰티 일일특가</h2></li>
                        <li><h3>고품격 뷰티 쇼핑 찬스!</h3></li>
                        <li>
                            <div className="timer">
                                <img src="./img/intro/timer.svg" alt="" />
                            </div>
                            <div className="timer-counter">
                                <span className='hours'>{time.H}</span>
                                <i>:</i>
                                <span className='minutes'>{time.M}</span>
                                <i>:</i>
                                <span className='seconds'>{time.S}</span>
                            </div>
                        </li>
                        <li><p>망설이면 늦어요!</p></li>
                    </ul>
                </div>
            </li>
            {
                상품.map((item, idx)=>{
                    return (
                        <li className="slide slide2" key={item.번호}>
                            <div className="slide-gap" onClick={(e)=>onClickViewProduct(e, item, `./img/intro/sec5_click.jpg`)}>
                                <div className="img-box">
                                    <img src={`./img/intro/${item.이미지}`} alt="sec5" />
                                    <span><img src="./img/intro/icon_cart_purple.svg" alt="cart" /></span>
                                </div>
                                <div className="text-box">
                                    <ul>
                                        <li>{item.상품소개}</li>
                                        <li>{item.상품이름}</li>
                                        <li>
                                            {
                                                item.할인율 > 0 ? (
                                                    <>
                                                        <strong>{Math.round(item.할인율*100)}%</strong>
                                                        <span>{Math.round((item.정가*(1-item.할인율))).toLocaleString('ko-KR')}원</span>
                                                        <em>{item.정가.toLocaleString('ko-KR')}원</em>
                                                    </>
                                                )
                                                :
                                                (
                                                    `${item.정가.toLocaleString('ko-KR')}원`
                                                )
                                            }
                                        </li>
                                        <li>
                                            <img src={`./img/intro/icon_review.svg`} alt="review" />
                                            <span>{`후기`}</span>
                                            <span>{item.후기카운트}</span>
                                        </li>
                                    </ul>
                                </div>
                            </div>
                        </li>
                    )
                })
            }
        </ul>
    );
};
